import React from "react";
import { BrowserRouter, Route, Router } from "react-router-dom";
import "./App.css";
import LibraryContainer from "./components/Library/LibraryContainer";
import Navbar from "./components/Navbar/Navbar";
import Game from "./components/Shop/Game/Game";
import GamePage from "./components/Shop/Game/GamePage/GamePage";
import ShopContainer from "./components/Shop/ShopContainer";

export const history = BrowserRouter();

function App() {
  return (
    <div className="app-wrapper">
      <Navbar />
      <div className="app-wrapper-content">
        <Router history={history}>
          <Route path="/shop" render={() => <ShopContainer />} />
          <Route path="/library" render={() => <LibraryContainer />} />
          <Route path="/gamepage" render={(props) => <GamePage {...props} />} />
          <Route path="/game" render={() => <Game />} />
        </Router>
      </div>
    </div>
  );
}

export default App;
